import React from 'react';
import './header.css';

const Header = () => {
  return (
    <div className='apex__header section__padding' id='home'>
      <div className='apex__header-content'>
        <h1 className='gradient__text'>Performance Perfected.  AI Vehicle Dynamics And Driving Analysis For Motorsports.</h1>
        <div className='apex__header-content__input'>
          <input type='email' placeholder='Your email adress'/>
          <button type="button">Get Started</button>
        </div>
      </div>
    </div>
  )
}

export default Header;
